import Heading from "./Heading";

const Trending = () => {
    return (
        <>
            <section className='trending'>
                <Heading title='hello' />
                {Trending.map((val) => {
                    return (
                        <div className="items">
                            <div className="box shadow">
                                <div className="images row">
                                    <div className="img">
                                        <img src="val.img" alt=""></img>
                                    </div>
                                </div>
                            </div>
                        </div>
                    )
                })}
            </section>
        </>
    );
}

export default Trending;
